function ifScript() {
	var obsIds = workflow.inputs.observable_ids;
	var domainId = workflow.inputs.domain_id;
	var implId = workflow.inputs.implementation_id;
	
	try {
		var eiqLookuptUtilProcess = new x_336871_eclectici.eiqLookuptUtil(implId, domainId);
		
		obsIds = eiqLookuptUtilProcess.filterObservables(obsIds);
		obsIds = obsIds.join(','); // make string again to fit into workflow input type
		
		if (!gs.nil(obsIds)) {
			workflow.scratchpad.obsIds = obsIds;
			return 'yes';
		}
		return 'no';
		
	} catch (err) {
		workflow.scratchpad.error_status = err;		
		return 'Error';		
	}
}

