	var domainId = workflow.inputs.domain_id;
	var observableIds = workflow.scratchpad.obsIds;
	var trackingId = data.get(7).capabilityExecutionId;
	
	var eiqLookuptUtilProcess = new x_336871_eclectici.eiqLookuptUtil(implId, domainId);
	var success = eiqLookuptUtilProcess.enrichObservable(trackingId, observableIds);
		
 	if (success)
 		return 'yes';
